import { Component } from "react";
import axios from "axios";
export default class UserPage extends Component {
  constructor() {
    super();
    this.state = {};
  }
  componentDidMount = () => {
    axios
      .get(`http://localhost:4000/${this.props.match.match.params.userId}`)
      .then((RESULT) => {
        console.log(RESULT);
      });
  };
  render() {
    return <h1>UserPage</h1>;
  }
}
